script: |
  super -f text -I q531.spq | sort > q531.out

inputs:
  - name: q531.spq
    data: |
      SELECT DISTINCT 83 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT NULL NOT IN ( + + col2 * + 51 * col2 + - + col1 - + col2 + - 19 + - col0 / - col0 );
  - name: tab1

outputs:
  - name: q531.out
    data: |
